text:
today‚Äôs been a bittersweet day. my little man bandit turned 11. it‚Äôs bittersweet because he is the one who started it all for me. and i fear the fact i could lose him at any point. he wasn‚Äôt supposed to make it through his first winter here with me. he was a rescue from louisiana. when i got him he was in a hoarder rescue. with scabs from being pushed over by other dogs. he rescued me no doubt about it. when i found out he had a collapsed trachea i knew he needed to be just a dog and not work. but it was hell to not work with him. hell, he never wanted to stop. 
anyways happy birthday bandit. 
